'''
designed by qiu
暴力方法就是每个window都排一次序，从有序的数组里面找中位数就好，但这个方法O((n-k+1)*klogk)
利用插入排序的方法，从[]开始往window里面加数，并使其一直保持有序的状态,先前保持有序的数就可以保存下来，
只用从后往前找插入位置就好。复杂度为O((n-k+1)*k)


'''
class Solution:
    def medianSlidingWindow(self, nums, k):
        if not nums:
            return []
        window = []
        ans = []
        for i, val in enumerate(nums):
            j = len(window)
            while j > 0 and window and window[j-1] > val:
                j -= 1
            window.insert(j, val)
            if i >= k-1:
                median = window[k//2] if k%2 == 1 else (window[k//2-1]+window[k//2])/2
                ans.append(median)
                window.remove(nums[i-k+1])
        return ans


