# 利用bisect来二分查找待删除的位置，利用insort_left来插入新来的元素
import bisect
class Solution:
    def medianSlidingWindow(self, nums: List[int], k: int) -> List[float]:
        if not nums:
            return []
        window = []
        ans = []
        for i, val in enumerate(nums):
            bisect.insort_left(window, val)
            if i >= k - 1:
                median = window[k // 2] if k % 2 == 1 else (window[k // 2 - 1] + window[k // 2]) / 2
                ans.append(median)
                index = bisect.bisect_left(window, nums[i - k + 1])
                window.pop(index)

        return ans